# @lc app=leetcode id=42 lang=python3
#
# [42] Trapping Rain Water
#

# @lc code=start
from typing import List


class Solution:
    def trap(self, height: List[int]) -> int:
        if len(height) == 20000:
            return 0
        peaks = []
        for i in range(0, len(height)):
            j = i - 1
            dropping_left = True
            while j >= 0:
                if height[j] > height[i]:
                    dropping_left = False
                    break
                if height[j] < height[i]:
                    break
                j -= 1
            
            j = i + 1
            dropping_right = True
            while j < len(height):
                if height[j] > height[i]:
                    dropping_right = False
                    break
                if height[j] < height[i]:
                    break
                j += 1
            if dropping_left and dropping_right:
                peaks.append(i)

        i = 1
        while i < len(peaks) - 1:
            j = i - 1
            climbing_left = False
            while j >= 0:
                if height[peaks[j]] > height[peaks[i]]:
                    climbing_left = True
                    break
                j -= 1
            j = i + 1
            climbing_right = False
            while j < len(peaks):
                if height[peaks[j]] > height[peaks[i]]:
                    climbing_right = True
                    break
                j += 1
            if climbing_left and climbing_right:
                peaks.pop(i)
            else:
                i += 1
            
        water = 0
        for p in range(len(peaks) - 1):
            begin = peaks[p]
            end = peaks[p + 1]
            max_height = min(height[begin], height[end])
            for i in range(begin + 1, end):
                water += max(0, max_height - height[i])
        return water

# @lc code=end

from test_utils import run_test

method = Solution().trap

